import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  footer:{
    display:'flex',
    width:'100%',
    justifyContent:'space-between'
  },
  links:{
    display:'flex',
    float:'right'
  },
  bar:{
    display:'flex'
  },
  firstColunm:{
    display:'flex',
  }
})
